ронидазол по 2 таб. 500 мг дважды в день. Если я забеременела, может ли это отразиться на ребенке, прием этих лекарств на таких сроках?";s:5:"files";s:0:"";s:4:"date";s:20:"14 апреля 2020";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:8:"МЦРМ";s:5:"image";a:2:{s:8:"ORIGINAL";s:29:"/upload/images/logo-short.png";s:7:"resized";s:29:"/upload/images/logo-short.png";}s:8:"position";s:0:"";s:4:"text";s:102:"Здравствуйте, Татьяна!
