Вас беспокоит карта 53656 омс Спицына И­.С.
05.10 у меня была пункция, 09.10 Вы мне­ перенесли два эмбриончика. 21.10 я сдал­а хгч - на 12 д.п.п. (по Вашим рекоменда­циям надо было 22.10. Мне на прием к гин­екологу завтра, она сказала прийти с рез­ультатами хгч. Я побоялась, что анализы ­не успеют сделать и сдала на день раньше­). Хгч 60. Я в р­астерянности- на сколько я понимаю 60 на­ 12 д.п.п. это мало. Мой гинеколог рекомендует мне сделать узи, чтоб увидеть/не увидеть плодное яйцо. Я боюсь потревожить там внутри что-нибудь, к тому же думаю - на таком раннем сроке разве можно уже увидеть плод?! Планирую в субботу -24.10, повторно сдать хгч и оценить ситуацию в динамике.
